$_MODULE['<{ntstats}prestashop>faq_c1d2c0a2ea8633b6ab80711bf354ff4b'] = 'Les fichiers CSV s\'ouvrent avec n\'importe quel tableur';
$_MODULE['<{ntstats}prestashop>faq_385e03095df6cced36e6049ce88af49c'] = 'Les fichiers CSV sont en UTF-8 et les valeurs sont séparées par des point-virgules';
$_MODULE['<{ntstats}prestashop>faq_57cf480337bb1497af02f284ca824d72'] = 'Des caractères bizarres apparaissent quand on ouvre le fichier CSV?';
$_MODULE['<{ntstats}prestashop>faq_085984a9851c2f27369eb2912dd1e280'] = 'Le fichier est encodé en UTF8 (Unicode international).';
$_MODULE['<{ntstats}prestashop>faq_d5c26aac16ededd3ab0d1486e971522a'] = 'Si vous utilisez Excel, ouvrez un classeur vierge, allez dans le menu Données et cliquez sur \"A partir d\'un fichier texte/CSV\". Après avoir choisi votre fichier, dans Origine du fichier, choisissez Unicode (UTF-8) (tout en bas de la liste).';
$_MODULE['<{ntstats}prestashop>faq_bee7dd3645050f8ed95183a8ca55f334'] = 'Si vous utilisez LibreOffice, lorsque vous ouvrez le fichier, il vous demande directement les infos. Dans Jeu de caractères, choisissez Unicode (UTF-8).';
$_MODULE['<{ntstats}prestashop>faq_8cb89975e3df60839d85e374bca3ceef'] = 'Que signifie la colonne Besoin ?';
$_MODULE['<{ntstats}prestashop>faq_9c2e60619d2c3362fc9543d0c23b1e62'] = 'Il s\'agit d\'un indice très simple pour maitriser les stocks en fonction des ventes. Il correspond à la formule : (quantité actuelle - quantité vendue) * -1.';
$_MODULE['<{ntstats}prestashop>faq_241a721e3fa1612d4d7c50bf36dbb433'] = 'Un nombre positif indique la quantité que vous avez besoin d\'acheter pour pouvoir vendre la même quantité sur la même période, vous n\'avez pas assez de stock pour ce produit.';
$_MODULE['<{ntstats}prestashop>faq_58da8a234d6ebaed3ec09553ed7b5e1d'] = 'Un nombre négatif indique la quantité dont vous devriez vous débarrassez (via des promos par exemple) car vous avez trop de stock pour ce produit si vous vendez la même quantité sur la même période.';
$_MODULE['<{ntstats}prestashop>faq_50fe9d94822e8a6d1ed52600d8c071cc'] = 'Comment mettre à jour le module ?';
$_MODULE['<{ntstats}prestashop>faq_c45a02babc859c783cc1a5b21b62cdfd'] = 'Vous devez télécharger la dernière version du module où vous l\'avez acheté.';
$_MODULE['<{ntstats}prestashop>faq_cf832f19d14486b25d11aaf8e9cc016d'] = 'Ensuite dans le backoffice de votre boutique, dans Modules > Gestionnaire de modules, cliquez sur le bouton Installer un module et choisissez le fichier zip du module.';
$_MODULE['<{ntstats}prestashop>faq_a9f902c1ce6abfbf5cd3573d49973d87'] = 'Prestashop détectera votre version actuelle et mettra automatiquement à jour votre module.';
$_MODULE['<{ntstats}prestashop>faq_3384251ff34a299aae3717020c8e0bfd'] = 'Il n\'est pas nécessaire de désinstaller le module au préalable.';
$_MODULE['<{ntstats}prestashop>faq_380ef96b1c7b37ad905cd5936af73b80'] = 'Que signifie la colonne \"Durée de stock\" ?';
$_MODULE['<{ntstats}prestashop>faq_515113cf7b9d6b48a8bc545a77bb9775'] = 'La colonne \"Durée de stock\" indique le nombre de jours de stock que vous avez, en fonction de la quantité de produits vendus durant la période choisie.';
$_MODULE['<{ntstats}prestashop>faq_28ab2c484acddc25bcbe2f2740ab115b'] = 'Pourquoi le nombre de commandes affichée dans le module est différent du nombre de commandes affichée dans l\'onglet Commande de Prestashop pour une meme journée ?';
$_MODULE['<{ntstats}prestashop>faq_3888ef42b833759863021e51386cfcf2'] = 'Par défaut le module affiche les commandes en fonctionne de la date de facture, pas de la date de création de la commande.';
$_MODULE['<{ntstats}prestashop>faq_d57075a75979b8bed6d01e8a54778c77'] = 'De plus l\'état des commandes doit être valide.';
